var tipuesearch = {"pages": [{'title': '課堂常用連結', 'text': 'wcm2023\xa0 https://mde.tw/wcm2023/content/index.html \xa0 \n 5j-5jg2\xa0 https://github.com/mdewcm2023/5j-5jg2 \xa0 \n exam\xa0 http://exam.cycu.org/ \xa0(IPv6) \n', 'tags': '', 'url': '課堂常用連結.html'}, {'title': 'vocabulary', 'text': 'cambridge_english_vocabulary_list.pdf \n The_Oxford_5000.pdf \n \n', 'tags': '', 'url': 'vocabulary.html'}, {'title': 'Chat GPT', 'text': "ChatGPT \n Q:鋼的楊氏係數 \n \n A:鋼的楊氏係數（Young's modulus of elasticity）是一種物理量，用來描述鋼材料的彈性變形特性。 \n 楊氏係數是指在材料受力下，其在垂直於受力方向上的形變程度與受力程度之間的比值。一般而言，楊氏係數越大，表示該材料的形變程度越小，即具有較高的彈性模量。在工程材料中，鋼的楊氏係數通常是在 190 GPa 至 210 GPa 之間。 \n 楊氏係數可以通過實驗測試或理論計算來獲得。實驗測試通常是利用壓縮試驗或拉伸試驗來測量材料在不同應變程度下的應力，然後根據楊氏係數的定義來計算楊氏係數。理論計算方面，通常是利用分子動力學模擬、密度泛函理論等方法來獲得楊氏係數的值。 \n 需要注意的是，鋼材料的楊氏係數在不同溫度和應變速率下可能存在變化，因此在實際應用中需要根據具體情況來進行調整和修正。 \n \n Q: 何謂轉動慣量 \n \n A:轉動慣量（moment of inertia）是一個物理量，用來描述物體繞某一軸線旋轉時其慣性（即旋轉慣性）的大小。在旋轉運動中，物體對不同軸線的旋轉慣性是不同的，因此需要使用轉動慣量來描述物體的旋轉特性。 \n 轉動慣量的大小取決於物體的質量分佈和旋轉軸線的位置和方向。一般而言，物體的轉動慣量越大，其繞軸線旋轉時所需的能量越大，旋轉的穩定性也越高。 \n 對於一個質量分佈均勻的剛體，其繞通過其質心的任意軸線的轉動慣量可以通過以下公式計算： \n I = (1/12) * m * (a^2 + b^2) \n 其中，m 是剛體的質量，a 和 b 分別是剛體在兩個互相垂直的軸線上的半徑。需要注意的是，當剛體的質量分佈不均勻或者旋轉軸線不穿過質心時，計算轉動慣量的公式會更加複雜，需要利用積分等方法進行求解。 \n Q: 何謂轉動動能 \n \n A:轉動動能（rotational kinetic energy）是一個物理量，用來描述物體的旋轉運動所擁有的能量。在物體繞著某一軸線旋轉時，由於其具有角速度，因此也就擁有了轉動動能。 \n 對於一個質量分佈均勻的剛體，其繞通過其質心的任意軸線的轉動動能可以通過以下公式計算： \n K = (1/2) * I * ω^2 \n 其中，I 是剛體繞軸線的轉動慣量，ω 是剛體的角速度。可以看出，轉動動能的大小與物體的轉動慣量和角速度的平方成正比，因此，當物體的轉動速度增加時，其轉動動能也會增加。 \n 需要注意的是，轉動動能只是物體繞著某一軸線旋轉所擁有的能量，與物體的線性運動沒有關係。在實際應用中，轉動動能通常會與物體的線性動能一起考慮，以計算物體的總機械能。 \n \n", 'tags': '', 'url': 'Chat GPT.html'}, {'title': '如何成為一位傑出的工程師- How to be a Star Engineer', 'text': '心得: \n 想要成為一名傑出的工程師 不一定要認真投入工作 能夠額外付出幫助同事並且能完成自身工作 \n 以下是關於如何成為一名優秀工程師的9個策略 \n \n 閃亮的軌跡 (Blazing trails) \n 知道該問誰 (Knowing who knows) \n 主動的自我管理 (Proactive self-management) \n 掌握全局 (Getting the big picture) \n 正確地追隨 (The right kind of followership) \n 團隊合作 (Teamwork as joint ownership of a project) \n 小領導者的領導風格 (Small-l leadership) \n 精明 (Street smarts) \n 呈現 (Show and tell) \n \n 第一個因素是技術知識和技能。工程師需要不斷學習和掌握最新的技術和工具，以保持競爭力。而這些技術知識和技能需要不斷地更新和提升，以跟上技術的發展。此外，良好的專業知識和經驗也是發揮領導作用的必要條件。 \n 第二個因素是溝通和協作能力。在現代工程領域中，很少有一個人能夠獨自完成整個項目。工程師需要與不同的團隊成員和部門合作，並能夠清晰地表達自己的想法和意見。如何建立良好的工作關係，以達到共同的目標也是重要的。 \n 第三個因素是自主學習和問題解決的能力。工程師需要有足夠的耐心和毅力來尋找解決方案，特別是在面對複雜的問題和挑戰時。工程師需要擅長運用科學的方法和技巧來解決問題，以達到更高的效率和創造力。 \n 最後，工程師需要對工作有熱情和動力。優秀工程師需要享受解決問題和創新的過程，並為自己的工作感到自豪和滿足。這種熱情和動力也會激勵工程師不斷地追求卓越和進步。 \n 總之，要成為一個優秀的工程師，不僅需要技術知識和技能，還需要溝通和協作能力、自主學習和問題解決能力，以及對工作的熱情和動力。這些特質和能力都可以通過不斷學習和實踐來提升，並且在職業生涯中持續發揮重要作用。 \n 當一個工程師表現平平時，通常不是因為他的能力不足。而是因為他從來沒有學過可以提高他生產力的工作策略。一旦他瞭解了這些策略，他就開始邁向傑出之路!', 'tags': '', 'url': '如何成為一位傑出的工程師- How to be a Star Engineer.html'}]};